RT @avalonia_night: #JusticeForAishwarya 
Rise in Rage.
@ShashiTharoor @chennithala @RahulGandhi @priyankagandhi

@Tyranismm He would tell Lucifer in such despiteful rage...

         ❛ To think after all this time I’ve let you live...At this point , I couldn’t careless if I loose my wings if I Killed you right here &amp; now..  ❜

        He said to him with such cold eyes in them now...
